import React from 'react';
import { useNavigate } from 'react-router-dom';
import './css/App.css';

import HomePage from './image/logo/home.png';

function Home() {
  const navigate = useNavigate();

  const handleButtonClick = (path) => {
    navigate(path);
  };

  return (
    <div className="home-container">
      <button onClick={() => handleButtonClick('/button1')}>
        Button 1
      </button>
      <button onClick={() => handleButtonClick('/button2')}>
        Button 2
      </button>
      <button onClick={() => handleButtonClick('/button3')}>
        Button 3
      </button>
      <button onClick={() => handleButtonClick('/button4')}>
        Button 4
      </button>
    </div>
  );
}

export default Home;
